import { IColumn, Stack, mergeStyleSets } from "@fluentui/react";
import axios from "axios";
import React from "react";
import { DragDropContext, Draggable, Droppable } from "react-beautiful-dnd";


interface ICustomList {
    columns: IColumn[],
    items: any[],
    onRenderItemColumn?: Function
}

interface IRule {
    id: number,
    name: string,
    rule: string,
}

const styles = mergeStyleSets({
    customListWrapper: {
        padding: 20,
        backgroundColor: "#e8f9ff",
        border: "3px dashed #42c5f5",
        overflowX: "auto",
        minHeight: '80px'
    },
    header: {
        backgroundColor: "#fff",
    },
    headerCol: {
        padding: '8px 12px',
        fontSize: 14,
        backgroundColor: "#fff",
        selectors: {
            ":hover": {
                backgroundColor: "#ededed"
            }
        }
    },
    row: {
        backgroundColor: "#fff",
        borderTop: '1px solid #ededed',
        borderBottom: '1px solid #ededed',
        fontSize: 12,
        padding: '4px 12px',
        selectors: {
            ":hover": {
                backgroundColor: "#ededed"
            }
        }

    },
    rowCol: {
        display: "inline-block",
    }
})
const Header: React.FunctionComponent<any> = (props: { columns: IColumn[] }): JSX.Element => {

    return (
        <Stack
            horizontal
            verticalAlign="center"
            className={styles.header}
        >
            {props?.columns?.map((item) => {
                return (
                    <div
                        className={styles.headerCol}
                        style={{
                            minWidth: item.minWidth,
                            maxWidth: item.minWidth,
                        }}

                    >
                        <strong>{item.name}</strong>
                    </div>
                )
            })}
        </Stack>
    )
}

const Row: React.FunctionComponent<any> = (props: { columns: IColumn[], items: IRule[], onRenderItemColumn }): JSX.Element => {
    return (<>
        <Droppable droppableId='row'>
            {(provided: any, snapshot: any) => (
                <div {...provided.droppableProps}
                    ref={provided.innerRef}
                    isDraggingOver={snapshot.isDraggingOver}
                >
                    {props?.items?.map((item, index) => (
                        <Draggable key={item.id} draggableId={String(item.id)} index={index}>
                            {(provided: any, snapshot: any) => (
                                <div
                                    ref={undefined}
                                    {...provided.dragHandleProps}
                                    {...provided.draggableProps}
                                    isDragging={snapshot.isDragging}
                                >
                                    <div className={styles.row}>
                                        {props.columns?.map((column) => {
                                            return (
                                                <div
                                                    className={styles.rowCol}
                                                    style={{
                                                        minWidth: column.minWidth,
                                                    }}
                                                >
                                                    {props.onRenderItemColumn(item, index, column) ?? item[column.fieldName]}
                                                </div>
                                            )
                                        })}
                                    </div>
                                </div>
                            )}
                        </Draggable>
                    ))}
                </div>
            )}
        </Droppable>
    </>
    )
}

const CustomList: React.FunctionComponent<ICustomList> = (props: ICustomList): JSX.Element => {
    const columns = props.columns;
    const items = props.items;
    const onRenderItemColumn = props.onRenderItemColumn;
    return (
        <DragDropContext onDragEnd={() => { }}>
            <div className={styles.customListWrapper}>
                <Header
                    columns={columns}
                />
                <Row
                    columns={columns}
                    items={items}
                    onRenderItemColumn={onRenderItemColumn}
                />
            </div>
        </DragDropContext>
    )
}

const onRenderItemColumn = (item: IRule, index: number, column: IColumn): JSX.Element | undefined => {
    switch (column.fieldName) {
        case "rule":
            return (<strong>{item.rule}</strong>)
            break;
        default:
            break;
    }
}
